import React from "react";
import styled from "@emotion/styled";

const HeaderContainer = styled.header`
  background-color: #26c6da;
  padding: 10px;
  font-weight: bold;
  color: #ffffff;
`;

const Header = ({ title }) => {
  return <h1>{title}</h1>;
};

export default Header;
